import React from 'react';

const InwardModule: React.FC = () => {
  return (
    <div className="space-y-6">
      <div className="bg-white shadow rounded-lg p-6">
        <h1 className="text-2xl font-bold text-gray-900 mb-4">Fabric Inward</h1>
        <p className="text-gray-600 mb-6">
          Add new fabric entries to the system with roll details and optional attachments.
        </p>

        {/* Placeholder for InwardForm component */}
        <div className="border-2 border-dashed border-gray-300 rounded-lg p-8 text-center">
          <p className="text-gray-500">Fabric Inward Form will be implemented here</p>
          <p className="text-sm text-gray-400 mt-2">
            Features: Main form, dynamic roll addition, rib details, file upload
          </p>
        </div>
      </div>
    </div>
  );
};

export default InwardModule;
